import React from 'react'

function Chats() {
    return (
        <div className='chats'>
             <div className='userChat'>
                <img src="https://images.pexels.com/photos/1116380/pexels-photo-1116380.jpeg?auto=compress&cs=tinysrgb&w=600" alt=''/>
                <div className='userChatInfo'>
                    <span>Khushii</span>
                </div>
            </div>
        </div>
    );
  }
  
  export default Chats;
